static void test_header( int heading )
{
        int n;

        /*
         *  If header[heading] is -1 it can only be set by headings that
         *  come after it, so that the comment will always appear after
         *  it's section has been completed.  This is the case for CAST.
         */

        if ( header[heading] != EXAMPLE_ALWAYS )
        {
	     header[heading] = DATA_EXISTS;
        }

        output = 1;

        for ( n = 0; n < heading; n++ )
        {
              if ( header[n] != DATA_EXISTS )
              {
                   give_example( n );
              }
        }
}

static void give_example( int heading )
{
        /*
         *  Mark that an example has been given, therefore data
         *  now exists.
         */

	header[heading] = DATA_EXISTS;

        printf( examples[heading] );

}
